●Terzoのルーフラック用オプション スパイダーネット EA69RM<br>●ネット部分はゴム製で伸長率は最大で180％あり、操作性抜群<br>●フックも持ち手付きで位置を自在に変えられるため、操作性抜群<br>●大型の荷物を固定する際におススメ<br><br>☆オプション ラインアップ<br>ホールドネット → EA69GM(90×90cm) / EA79GL(120×110cm)<br>スパイダーネット → EA69RM(90×90cm) / EA79RL(110×110cm)<br>ルーフラック用キーケースセット → EA30K<br>リンクストラップ → EA72S(1本入り) / EA72W(2本入り)<br>ストレッチコード → EA124C / EA124F<style type="text/css">
